import React from 'react';

class MainPage extends React.Component {
   render() { 
      return (
      <section className='hero py-4 px-24'>
      <div className='container mx-auto items-center justify-between relative'>
         <h1 className='text-6xl relative text-transparent
         bg-clip-text bg-gradient-to-r from-blue-700 to-green-500 text-center block'>
         Use <strong>AI</strong> to solve, write & work</h1>
         <p className='text-xl text-gray-500 text-center m-w-32'>Enhance everything you do by using the latest 
            from OpenAI to solve problems, write solutions
             and make life easier.</p>
      </div>
      </section>
      );
   }
}

export default MainPage;
